import { useState, useEffect } from "react";
import Navbar from "./components/Navbar";
import Button from "./components/Button";
import "./components/styles/index.css";

function App() {
  const [currentTime, setCurrentTime] = useState(0);

  useEffect(() => {
    fetch("/index")
      .then((res) => res.json())
      .then((data) => {
        setCurrentTime(data.time);
      });
  }, []);

  /* const redirectTo = (link) => {
    window.location.replace(`/${link}`);
  }; */

  return (
    <>
      <Navbar />
      <Button size="sm" variant="primary">
        Click Me!
      </Button>
      <Button size="mid" variant="secondary">
        Click Me!
      </Button>
      <Button size="lg" variant="danger">
        Click Me!
      </Button>
      <Button size="xl" variant="warning">
        Click Me!
      </Button>
      <Button size="xxl" variant="success">
        Click Me!
      </Button>
      <Button size="sm" variant="primary" outline={true}>
        Click Me!
      </Button>
      <Button size="sm" variant="secondary" outline={true}>
        Click Me!
      </Button>
      <Button size="sm" variant="danger" outline={true}>
        Click Me!
      </Button>
      <Button size="sm" variant="warning" outline={true}>
        Click Me!
      </Button>
      <Button size="sm" variant="success" outline={true}>
        Click Me!
      </Button>
      <p>The current time is {currentTime}.</p>
    </>
  );
}

export default App;
